import { takeEvery } from 'redux-saga/effects';
import { fetchUsers } from '../../utils/fetch.data';

export function* fetchUsersAsync() {
    const users = yield fetchUsers();
    console.log('i am fired ', users);

}
export function* fetchUsersStart() {
    yield takeEvery(
        'FETCH_USERS_START',
        fetchUsersAsync
    );
}
